import React from "react"

export default() =>

<div style={{display: "grid"}}>
    <input
      type = "email"
      name = "email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      placeholder = "Password"/>

      <div className="regist"><a href=''>Don't have account? Register Here!</a></div>
      <button className="login">Login</button>
<style jsx global>{`
    body {
        background: #FFFFF;
        font-family: 'Open Sans', sans-serif;
    }

    div {
        margin: 0 auto;
        display: block;
    }
`}</style>
</div>
